import React from "react";
import "./genere-list.scss";
import UUID from "uuidjs"

const GenereList = ({list}) =>{

    if(!list || !list.length){
        return null;
    }

    return (
            <ul className="genere-list">
                {list.map( genere => {
                    return (<li key={UUID.genV1()}> {genere.name} </li>)
                })}
            </ul>
    )
}

export default GenereList
